/**
 * spec document for PdfImage.ts class
 */
import { PdfDocument, PdfPage, PdfGraphics, PdfString, PointF, SizeF } from "../../../../../src/index";
import { IPdfPrimitive, PdfImage, PdfBitmap, RectangleF } from "../../../../../src/index";

describe('PdfImage.ts', () => {
    it('Constructor initializing', () => {
        let test: string = "";
        let t1: PdfImage = new PdfBitmap(test);
        expect(t1).not.toBeUndefined();
        t1.getPointSize(50, 50);
        expect(t1.getPointSize(50, 50)).not.toBeUndefined();
        t1.getPointSize(50, 50, 96, 96);
        expect(t1.getPointSize(50, 50, 96, 96)).not.toBeUndefined();
        //Image Drawing
        let logo: string = ""
        let image: PdfImage = new PdfBitmap(logo);
        let document: PdfDocument = new PdfDocument();
        let page: PdfPage = document.pages.add();
        let graphics: PdfGraphics = page.graphics;
        graphics.drawImage(image, 20, 50);
        graphics.drawImage(image, 20, 450, 50, 25);
        graphics.clientSize.height = -1;
        graphics.drawImage(image, 140, 450, 50, 25);
        //For image insertion in pdf grid
        image.size = new SizeF(100, 200);
        graphics.drawImage(image, 140, 450, 50, 25);
        // graphics.DrawString('image', new PdfStandardFont(FontEnum.PdfFontFamily.Helvetica, 10), PdfBrushes.Blue, new PointF(10, 10));
        // document.Save('image.pdf');
    });
});